import {makeAutoObservable} from "mobx";

export default class HistoryStore {
    constructor() {
        this._history = [
            {id: 1, name: "Китти", breed: "дворовая", gender: "девочка", age: 5, pet_status: "дома", date: "10.10.2010", status: "выполнено"},
            {id: 2, name: "Чуча", breed: "британская", gender: "мальчик", age: 3, pet_status: "в приюте", date: "10.10.2010", status: "выполнено"},
            {id: 3, name: "Бруно", breed: "лабрадор", gender: "мальчик", age: 8, pet_status: "в ожидании", date: "05.05.2023", status: "принято"},
            {id: 4, name: "Флора", breed: "корги", gender: "девочка", age: 2, pet_status: "дома", date: "10.10.2010", status: "выполнено"},
        ]
        makeAutoObservable(this)
    }

    setHistory(history) {
        this._history = history
    }

    get history() {
        return this._history
    }
}
